INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (321, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 1, 125801, 24001, 0, 40011, "リリ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (322, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 2, 1, 126001, 24001, 0, 40011, "クリア");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (323, 1, "んーと。\nこれ、あげる。\nはい", 3, 2, 1, 126101, 24001, 0, 40011, "プレシア");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (324, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 2, 2, 125801, 24001, 0, 40011, "リリ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (325, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 2, 2, 126001, 24001, 0, 40011, "クリア");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (326, 1, "お兄。\nきてくれて、うれしい", 6, 2, 2, 126101, 24001, 0, 40011, "プレシア");
